import React from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import Services from './pages/Services';

function App() {
  return (
    <Routes>
      <Route index component={<Home />} />
      <Route path='/services' component={<Services />} />
    </Routes>
  );
}

export default App;
